ct me!\n</p>',0,0,'2018-08-05 02:58:38'),(29,571,935,0,'请问联系方式是微信吗，搜索不到。怎么联系你呢',0,0,'2018-08-05 12:31:53'),(30,7,1115,0,'什么车',0,0,'2018-08-07 03:19:42'),(31,7,1115,30,'12',0,0,'2018-08-07 03:19:52'),(32,7,1115,30,'1',0,0,'2018-08-07 03:21:16'),(33,7,1115,32,'和',0,0,'2018-08-07 03:22:27'),(34,637,1117,0,'<p>\n	该HOUSE所在区安全，走路15-20到EINSTEIN MEDICAL COLLEGE.Busx12与可转地铁，1,2,4,5,和A，地铁A与BusxI2 &nbsp; 24小时通车。靠近长岛海湾，走路20-30分钟，开车5一IO分享到达酒湾，乘Busx12，1一3站到动物园与植物园。谢谢关注，iacksun FOR&nbsp;\n</p>\n<p>\n	2316 guntheR AVENUE\n</p>\n<p>\n	PELHAM garden, NEW YORK 10469\n</p>',0,0,'2018-08-07 06:04:33'),(35,637,1117,0,'<p>\n	该HOUSE所在区安全，走路15-20到EINSTEIN MEDICAL COLLEGE.Busx12与可转地铁，1,2,4,5,和A，地铁A与BusxI2 &nbsp; 24小时通车。靠近长岛海湾，走路20-30分钟，开车5一IO分享到达酒湾，乘Busx12，1一3站到动物园与植物园。谢谢关注，iacksun FOR&nbsp;\n</p>\n<p>\n	2316 guntheR AVENUE\n</p>\n<p>\n	PELHAM garden, NEW YORK 10469\n</p>',0,0,'2018-08-07 06:04:33'),(36,49,1119,0,'具体贴在哪里？',0,0,'2018-08-07 06:17:43'),(37,638,1119,36,'電影院門口 餐廳門口等等 多人看到的地方 具體地方沒有限制',0,0,'2018-08-07 06:18:33'),(38,49,1052,0,'这是哪一年买的啊',0,0,'2018-08-07 06:22:32'),(39,637,965,0,'<p>\n	一House, 靠近爱茵斯旦医学院，一间660美元，一间750美元/一个月，地址\n</p>\n<p>\n	1535 WARING AVENUE v\n</p>\n<p>\n	PELHAM garden, NEW YORK, 10469\n</p>\n<p>\n	有兴趣call JACKSUN AT 718-513-0385 or&nbsp;\n</p>\n<p>\n	917-635-2608. &nbsp; &nbsp;THANKS&nbsp;\n</p>',0,0,'2018-08-07 06:28:36'),(40,16,1052,38,'去年年底',0,0,'2018-08-07 06:54:29'),(41,609,1082,0,'我是川湘小炒的石师傅（小马哥），多谢各位过来捧场的同学们，你们吃的开心，才是我最大的成就。记得添加我们的微信哦，我们会经常推出新菜的，也欢迎各位发微信过来咨询，希望你们在异国他乡能品尝到家乡的味道。祝同学们学业有成，生活愉快！',0,0,'2018-08-07 21:37:33'),(42,516,1068,0,'鏡子還有嗎？謝謝',0,0,'2018-08-09 02:08:06'),(43,516,1049,0,'小方桌和書桌還在嗎？',0,0,'2018-08-09 02:14:14'),(44,7,1150,0,'3',0,0,'2018-08-11 12:17:13'),(45,7,1150,44,'Q',0,0,'2018-08-11 12:17:22'),(46,649,1045,0,'<p>\n	您好，请问打印机还在么？\n</p>',0,0,'2018-08-11 14:24:26'),(47,189,891,0,'我想要吸尘器和体重秤，请问可以送货吗？MQ附近',0,0,'2018-08-13 02:03:51'),(48,520,1151,0,'<p>\n	还在吗\n</p>\n<p>\n	<br />\n</p>',0,0,'2018-08-13 08:39:01'),(49,49,1177,0,'电子书可以吗',0,0,'2018-