DROP TABLE IF EXISTS `tbl_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tbl_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `openid` varchar(64) NOT NULL COMMENT '微信服务号openid',
  `rid` int(11) NOT NULL COMMENT '校区id',
  `username` varchar(32) NOT NULL COMMENT '用户名(邮箱/手机号)',
  `password` varchar(65) NOT NULL COMMENT '密码',
  `nickname` varchar(32) NOT NULL COMMENT '姓名',
  `mobile` varchar(32) NOT NULL COMMENT '电话',
  `email` varchar(65) NOT NULL COMMENT '邮箱',
  `avatar` varchar(255) NOT NULL COMMENT '头像',
  `level` tinyint(1) NOT NULL COMMENT '等级：0注册用户，-1导入用户',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `createtime` datetime NOT NULL COMMENT '注册时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `openid` (`openid`)
) ENGINE=InnoDB AUTO_INCREMENT=729 DEFAULT CHARSET=utf8 COMMENT='用户表';
